import './Tables.scss';
import { Row } from './Row';

import MondaySchedule from "../../data/MondaySchedule.json";
import TuesdaySchedule from "../../data/TuesdaySchedule.json";
import WednesdaySchedule from "../../data/WednesdaySchedule.json";
import ThursdaySchedule from "../../data/ThursdaySchedule.json";
import FridaySchedule from "../../data/FridaySchedule.json";
import SaturdaySchedule from "../../data/SaturdaySchedule.json";
import SundaySchedule from "../../data/SundaySchedule.json";



export const Tables = () => {
  return (
      <div className="tables">
        <thead className='thead'>
            <tr>
            <th className='thead-th'> </th>
            <th className='thead-th'>Monday</th>
            <th className='thead-th'>Tuesday</th>
            <th className='thead-th'>Wednesday</th>
            <th className='thead-th'>Thursday</th>
            <th className='thead-th'>Friday</th>
            <th className='thead-th'>Saturday</th>
            <th className='thead-th'>Sunday</th>

            </tr>
        </thead>
        <tbody>

        </tbody>
      </div>
  );
}
